import React from "react";
import { useState } from "react";
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Link from '@mui/material/Link';
import { styled } from '@mui/material/styles';
import useScrollTrigger from '@mui/material/useScrollTrigger';
import { Typography } from "@mui/material";
import { makeStyles } from '@mui/styles';

import { Link as RouterLink} from "react-router-dom";

import logo from '../../assets/logo2.jpg'
import theme from "../UI/Theme";

function ElevationScroll(props) {
  const { children } = props;
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 0,
  });

  return React.cloneElement(children, {
    elevation: trigger ? 4 : 0,
  });
}

const useStyles = makeStyles(theme => ({
  toolbarMargin: {
    ...theme.mixins.toolbar
  },
  logo: {
    height: "2em",
    paddingLeft: "1%"
  },
  tabContainer: {
    marginLeft: "auto",
    marginRight: "auto"
  },
  tab: {
    fontWeight: 900
  }
}))

const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none"
})

const OutlinedButton = styled(Button)({
  ...theme.typography.buttonCustomization
})

const Header = (props) => {
  const classes = useStyles();
  const [value, setValue] = useState('one');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <React.Fragment>
      <ElevationScroll>
        {/* <Box sx={{ flexGrow: 1 }}> */}
          <AppBar position="fixed">
            <Toolbar disableGutters={false}>
              <Typography variant="h3">FINTECHPORT</Typography>
              <Link component={RouterLink} to="/" underline="none">
                <img alt="company logo" src={logo} className={classes.logo} />
              </Link>
              <Tabs
                value={value}
                onChange={handleChange}
                textColor="secondary"
                indicatorColor="secondary"
                aria-label="secondary tabs example"
                className={classes.tabContainer}
              >
                <Tab 
                  value="one" 
                  label="Innovation Lab" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/innovation-lab"
                />
                <Tab 
                  value="two" 
                  label="Submit an Idea" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/submission-form"
                />
                <Tab 
                  value="three" 
                  label="What's New" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/tech-connect"
                />
                <Tab 
                  value="four" 
                  label="About Us" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/about-us"
                />
                <Tab 
                  value="five" 
                  label="Our Contacts" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/contacts"
                />
              </Tabs>
              <Stack spacing={2} direction="row">
                <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
                <OutlinedButton variant="outlined" color="secondary">Sign Up</OutlinedButton>
              </Stack>
              {/* <IconButton
                size="large"
                edge="start"
                color="inherit"
                aria-label="menu"
                sx={{ mr: 2 }}
              >
                <MenuIcon />
              </IconButton>
              <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                News
              </Typography>
              <Button color="inherit">Login</Button> */}
            </Toolbar>
          </AppBar>
        {/* </Box> */}
      </ElevationScroll>
      <div className={classes.toolbarMargin}/>
    </React.Fragment>
  )
}

export default Header;
